import React from "react";
import { useNavigate } from "react-router-dom"; // We can use navigate for routing
import "../css/LandingPage.css";

function LandingPage({ onChatbotOpen }) {
    const navigate = useNavigate(); // Use useNavigate hook to navigate to chatbot

    const handleChatbotOpen = () => {
        // Navigating to the chatbot route
        navigate("/chatbot");
    };

    return (
        <div className="landing-page">
            <h1>Welcome to the Chatbot Demo</h1>
            <p>Click below to interact with our AI-powered chatbot.</p>
            <button
                className="open-chatbot-button"
                onClick={handleChatbotOpen} // Open chatbot on click
            >
                Open Chatbot
            </button>
        </div>
    );
}

export default LandingPage;
